-- Table structure for `hflow_signature`
-- ----------------------------
DROP TABLE IF EXISTS `hflow_signature`;
CREATE TABLE `hflow_signature` (
  `id` varchar(64) NOT NULL,
  `process_instance_id` varchar(200) DEFAULT NULL,
  `task_def_key` varchar(200) DEFAULT NULL,
  `task_def_name` varchar(200) DEFAULT NULL,
  `pro_id` varchar(200) DEFAULT NULL,
  `handler` varchar(200) DEFAULT NULL,
  `handler_id` varchar(200) DEFAULT NULL,
  `handler_dept_name` varchar(200) DEFAULT NULL,
  `send_date` datetime DEFAULT NULL,
  `sender` varchar(200) DEFAULT NULL,
  `sender_dept_name` varchar(200) DEFAULT NULL,
  `use_date` varchar(100) DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `opinion` varchar(2000) DEFAULT NULL,
  `p_sort` int(11) NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`id`),
  UNIQUE KEY `p_sort` (`p_sort`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=99 DEFAULT CHARSET=utf8;

